def remove_duplicates(lst):

    """Remove os valores repetidos de uma lista
    utilizando o método de repetição para os elementos"""

    for i in range(len(lst)):
        for j in range(i+1, len(lst)):
            if lst[i] == lst[j]:
                del lst[j]
    return lst
