def analyze_text(text):
    """Analyze a text and return a dictionary with the number of words and sentences of each word.

    Args:
        text (str): A text to analyze.

    Returns:
        dict: A dictionary with the number of words and sentences of each word.
    """
    word_count = 0
    sentence_count = 0
    for word in text.split():
        if word.isalpha():
            word_count += 1
        if not word.isalpha() and word.isnumeric():
            sentence_count += 1
    return {
        'words': word_count,
'sentences': sentence_count
}

